import React, { Component } from "react";

class Matches extends Component {
  constructor(props) {
    super(props);
  }

  componentDidMount() {
    document.getElementById(`this.props.matches`).style.color = "white";
  }
  render() {
    return (
      <div>
        <h1 className="matchesHeader">Matches View</h1>
      </div>
    );
  }
}

export default Matches;
